واتسكنت معا المساجين\n\nصورتك انتي بقا ع الفون "},{"text":"2:09"},{"text":"\nبت حلوه واحلي عيون\nايوه حبك بيكي مجنون\nحبك انتي ادمان جوايا\n\nلاف عمري الي بدمنها\nايوا عايش عمري عشنها\nقلبي كلو ده ليها ومكانها\nمن اجلها اعمل انا جنايا\n\nبت\nده انا علشانك انتي اتغيرت\nوبقيت حد جديد دلوقت\nبعد ما كنت صايع بطلت\nوبقيت ماشي ف حالي\n\nوهديت\nحبيتك اه من اول ديت\nلما انا ف عيونك بصيت\nقولت ل امي اني انا لقيت\nروحي وام عيالي\n\nالشارع فوضي وعملني كل \nخصمك قبل مايكلك\nتحترم كل الناس يبني لو هتزود\n ف مشاكلك\nتمشي مخطر نفسك كلو\n يهبك ويخاف من شكلك\nخلي سلاح يبقا زميلك اوعا \nتشيلو يوم من جمبك\n\n انت اخويا زميلي انا ف ضهرك\nوانت فردتي هفضل جمبك\nوامك امي وامي انا امك\nوانت بيبتي ياعم ده بيتك..\n\nكان هدفهم نخسر بعض\nربنا مش ع كيف حد\nالي بنا رجوله بجد\nوانا هفضل ايدي ف ايدك\n\n"},{"text":"#عصام_صاصا","navigationEndpoint":{"clickTrackingParams":"CMcDELsvGAAiEwju2sKryPyGAxUqOAYAHZnVAWI=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/%D8%B9%D8%B5%D8%A7%D9%85_%D8%B5%D8%A7%D8%B5%D8%A7","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUVChHYudi12KfZhV_Ytdin2LXYpxgB"}}},{"text":"\n"},{"text":"#امين_خطاب","navigationEndpoint":{"clickTrackingParams":"CMcDELsvGAAiEwju2sKryPyGAxUqOAYAHZnVAWI=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/%D8%A7%D9%85%D9%8A%D9%86_%D8%AE%D8%B7%D8%A7%D8%A8","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUVChHYp9mF2YrZhl_Yrti32KfYqBgB"}}},{"text":"\n"},{"text":"#احنا_صيع_منحرفين","navigationEndpoint":{"clickTrackingParams":"CMcDELsvGAAiEwju2sKryPyGAxUqOAYAHZnVAWI=","commandMetadata":{"webCommandMetadata":{"url":"/hashtag/%D8%A7%D8%AD%D9%86%D8%A7_%D8%B5%D9%8A%D8%B9_%D9%85%D9%86%D8%AD%D8%B1%D9%81%D9%8A%D9%86","webPageType":"WEB_PAGE_TYPE_BROWSE","rootVe":6827,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"FEhashtag","params":"6gUiCh7Yp9it2YbY
